import React from 'react'
import { useState } from 'react';
export {email, setEmail} from './Form'
function Login() {
    const[email,setEmail]=useState("");
    const[password,setPassword]=useState("");


  return (
   <>
            <div>
                    <label htmlFor='email'>Email</label>
                <input type="text" name="email"  value={email} onChange={(e)=>{setEmail(e.target.value)}} id="email"></input>
                </div>

    <div>
                    <label htmlFor='email'>Email</label>
                <input type="text" name="pass"  value={password} onChange={(e)=>{setPassword(e.target.value)}} id="email"></input>
                </div>
    </>
  )
}

export default Login
